// SignIn.js

import React from "react";
import * as S from '../App.styles';
import 'primeicons/primeicons.css';
import FormsSignIn from "../components/FormsSignIn";

const SignIn = () => {
    return(
        <>
        <S.HeaderLogin />
        <S.ContainerSignIn>
            <S.AlredySignIn>
                <h2>Já sou cadastrado!</h2>
                <h4>Para se autenticar, informe seu e-mail e senha:</h4>
                <FormsSignIn />
            </S.AlredySignIn>
            <S.FirstBuySignIn>
                <h2>Esta é minha primeira compra</h2>
                <h4>O cadastro em nossa loja é simples e rápido</h4>
                {/* Conteúdo para a primeira compra */}
            </S.FirstBuySignIn>
        </S.ContainerSignIn>
        </>
    )
}

export default SignIn;
